import TodoItem from './TodoItem'

class ToDo extends Component {

    state = {
        todos:
        [
            {
                id:1,
                title: "Primeiro Item",
                completed: false
            },
            {
                id:2,
                title: "Segundo Item",
                completed: false
            },
            {
                id:3,
                title: "Terceiro Item",
                completed: false
            }
        ]
    }

    render() {
        this.state.todos.map((teste) =>
            <p>teste.title</p>
        )
        return  <p> {this.state.todos[0].title} </p>
    }

}

